import { useState } from 'react';
import axios from 'axios';
import styles from './RepoSelector.module.css';

interface RepoSelectorProps {
  onGeneratePath: (learningPath: any) => void;
  setLoading: (isLoading: boolean) => void;
  setError: (error: string | null) => void;
}

const RepoSelector: React.FC<RepoSelectorProps> = ({ 
  onGeneratePath,
  setLoading,
  setError
}) => {
  const [repoUrl, setRepoUrl] = useState('');
  const [experienceLevel, setExperienceLevel] = useState('beginner');
  const [focusAreas, setFocusAreas] = useState<string[]>([]);
  const [availableFocusAreas] = useState([
    { id: 'frontend', label: 'Frontend' },
    { id: 'backend', label: 'Backend' },
    { id: 'testing', label: 'Testing' },
    { id: 'architecture', label: 'Architecture' },
    { id: 'deployment', label: 'Deployment' },
    { id: 'performance', label: 'Performance' }
  ]);

  const handleFocusAreaChange = (areaId: string) => {
    setFocusAreas(prev => 
      prev.includes(areaId) 
        ? prev.filter(id => id !== areaId)
        : [...prev, areaId]
    );
  };

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    setLoading(true);
    setError(null);

    try {
      // Get access token - in a real app, this would come from auth system
      const token = localStorage.getItem('access_token') || 'demo_token';

      const response = await axios.post(
        '/api/generate-learning-path', 
        {
          repo_url: repoUrl,
          user_experience_level: experienceLevel,
          focus_areas: focusAreas
        },
        {
          headers: {
            'Authorization': `Bearer ${token}`
          }
        }
      );

      onGeneratePath(response.data);
    } catch (err: any) {
      console.error('Error generating learning path:', err);
      setError(err.response?.data?.detail || 'Failed to generate learning path');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className={styles.container}>
      <h2 className={styles.title}>Generate Learning Path</h2>
      <p className={styles.description}>
        Enter a GitHub repository URL to generate a personalized learning path.
      </p>

      <form onSubmit={handleSubmit} className={styles.form}>
        <div className={styles.formGroup}>
          <label htmlFor="repo-url">GitHub Repository URL</label>
          <input
            id="repo-url"
            type="url"
            className={styles.input}
            placeholder="https://github.com/username/repository"
            value={repoUrl}
            onChange={(e) => setRepoUrl(e.target.value)}
            required
          />
        </div>

        <div className={styles.formGroup}>
          <label htmlFor="experience">Your Experience Level</label>
          <select
            id="experience"
            className={styles.select}
            value={experienceLevel}
            onChange={(e) => setExperienceLevel(e.target.value)}
          >
            <option value="beginner">Beginner</option>
            <option value="intermediate">Intermediate</option>
            <option value="advanced">Advanced</option>
          </select>
        </div>

        <div className={styles.formGroup}>
          <label>Focus Areas (Optional)</label>
          <div className={styles.checkboxGroup}>
            {availableFocusAreas.map(area => (
              <div key={area.id} className={styles.checkbox}>
                <input
                  id={`focus-${area.id}`}
                  type="checkbox"
                  checked={focusAreas.includes(area.id)}
                  onChange={() => handleFocusAreaChange(area.id)}
                />
                <label htmlFor={`focus-${area.id}`}>{area.label}</label>
              </div>
            ))}
          </div>
        </div>

        <button type="submit" className={styles.submitButton}>
          Generate Learning Path
        </button>
      </form>
    </div>
  );
};

export default RepoSelector;
